import React from "react";

import Question from "../"
import IQuestion from "../../Models/IQuestion";

interface IProps {
  questions: IQuestion[];
}

const Questions: React.FC<IProps> = ({ questions }) => {
  return <>
    {questions && questions.map(question => {
        return <Question />
    })} 
  </>;
};

export default Questions;
